package com.demo.stack_queue_linkedList;


//队列            先进先出的数据结构
public class QueueDemo {

	public static void main(String[] args) {
		
		String str = "631758924";
		int[] array = new int[str.length()];
		
		for (int i = 0; i < str.length(); i++) {
			array[i] = Integer.valueOf(str.substring(i, i+1));
		}
		int[] analysis = analysis(array);
		for (int i = 0; i < analysis.length; i++) {
			System.out.println(analysis[i]);
		}
	}
	
	public static int[] analysis(int[] array){
		
		int[] resArr = new int[array.length];
		
		int[] subArr = new int[array.length*3];
		
		for (int i = 0,length = array.length; i < length; i++){
			subArr[i] = array[i];
		}
		int j = 0;
		int t = array.length;
		for(int i = 0,length = subArr.length; i< length; i++){
			if((i+2)%2 == 0){
				resArr[j] = subArr[i];
				subArr[t] = subArr[i+1];
				j++;
				t++;
				if(j == resArr.length){
					return resArr;
				}
			}
		}
		return null;
	}
	
}
